import React from "react";
import "./cart.scss";
const CartItem = ({ img, name, count, price, type, size, basis }) => {
  return (
    <div className="cart__oder">
      <table className="cart__date">
        <tr>
          <td className="cart__date-item">
            <img className="cart__date-img" src={img} alt="" />

            <div className="cart__date-name">{name}</div>
            <div className="cart__date-type">тісто:{type}</div>
            <div className="cart__date-size">розмір:{size}</div>
            <div className="cart__date-size">основа:{basis}</div>
          </td>
          <td className="cart__date-amount">{count}</td>
          <td className="cart__date-price">{price}</td>
        </tr>
      </table>
    </div>
  );
};

export default CartItem;
